sample: '["\"Mga Kanegosyo, sa pagdating ng Hunyo, patapos na tayo sa unang kalahati
  ng taon. Kumusta na ang ating pinapatakbong negosyo? Sana\u2019y nakatutulong kami
  sa pagpapalago ng inyong pangkabuhayan sa mga kuwento at tips na tinatalakay natin
  sa kolum na ito.\\nNgayong linggo, pag-usapan natin ang kahalagahan ng isang bukas
  na isip sa mga pagbabagong nangyayari sa ating mundo sa kasalukuyan.\\nMga Kanegosyo,
  kung sarado ang ating isipan sa mga bago at sariwang ideya, sistema at mga bagay-bagay,
  tiyak na mapag-iiwanan tayo sa mabilis na takbo ng buhay.\\nSa pagnenegosyo, kapag
  sarado ang ating isip sa mga suhestiyon, bagong ideya o \u2018di kaya\u2019y modernong
  sistema, tiyak na kakain tayo ng alikabok sa mga kakumpitensya sa merkado.\\nHindi
  lang basta nagmamasid sa merkado tayong mga negosyante; naghahanap din tayo ng makabagong
  ideya upang mapaganda ang negosyo sa pamamagitan ng pagbabasa at pananaliksik.\\nMaituturing
  na bukas ang isip ng isang negosyante kung handa tayong tumanggap ng panukala, komento
  at mga tanong sa produkto at serbisyo natin.\\nMagandang kumuha ng mga bagong ideya
  sa kapalirigan, sa ating mga tauhan, pamilya, mga kaibigan, ang ating mga suki at
  maging ang mga kakumpitensya.\\nMakakakuha rin ng mga bagong ideya mula sa mga aklat,
  magazine, video, newsletter, seminar at sa Internet.\\n***\\nKapag galing sa isang
  bigong pag-ibig, ang iba sa atin ay bumibiyahe sa malalayong lugar upang doon magpalipas
  ng sama ng loob, makapag-isip-isip at makapagpahinga.\\nGanito ang pinagdaanan ni
  Cathy Brillantes-Turvill. Galing siya sa bigong pag-ibig at naghanap ng paglilibangan
  para malayo ang isip sa pait na nararamdaman.\\nUpang makalimot, naging madalas
  ang pagpunta niya sa isang kumbento sa Tagaytay upang doon magdasal at magmuni-muni.\\nSa
  madalas niyang pagbalik-balik sa Tagaytay, napansin niya na walang spa sa nasabing
  lugar na makatutulong sa kanyang makapagpahinga.\\nNagkataong nakilala ni Cathy
  ang isang British chemist na si Dr. Mike Turvill, na supplier ng essential oils
  sa mga spa sa five-star hotel sa Metro Manila.\\nNabanggit niya ang ideya kay Mike,
  na siya namang kumumbinsi sa kanya na ituloy ang pangarap na negosyo, na ngayo\u2019y
  kilala bilang Nurture Spa.\\nSinimulan niya ang bagong negosyo, na mayroon lang
  dalawang kuwarto. Nang tumagal, lumaki ang spa, na ngayo\u2019y mayroon ng anim
  na gazebo, siyam na indoor massage rooms, apat na native huts, pitong airconditioned
  rooms at isang seminar room.\\nKahit matagumpay na, bukas pa rin ang isip niya sa
  mga pagbabago sa industriya. Parati siyang nagsasaliksik at sumasali sa mga conference
  upang matutunan ang makabagong technique sa pagmamasahe at pagpapatakbo ng spa,
  bukod sa pakikinig sa mga komento ng kanyang mga customer.\\nHindi lang naging naging
  bukas ang isip niya sa pagnenegosyo. Naging bukas din ang kanyang puso kay Mike,
  na siyang naging asawa niya.\\nKaya mga Kanegosyo, kapag bukas tayo sa mga bagay-bagay,
  tunay na walang limit ang daan tungo sa tagumpay!\\nFirst Published on Abante Online\"",
