  yan for a purpose.\\n4. Pumili ng mga tamang kaibigan.\\nMay kakilala ako, matino
  nuong bata sya pero nagsimula syang mapabarkada sa mga nag-aadik, hanggang sa lumaki
  syang adik at kung ano ang kinikilos ng barkada nya ay kilos na din nya.\\nSa edad
  mo na yan, madami ka ng kaibigan pero sila ba ay nakakatulong sa\u2019yo, nagnunurture
  sa\u2019yo, tinutulungan at ineencourage ka ba to be the best version of you?\\nKung
  hindi at lagi na lang paninira, chismis, negative sa buhay ang mga kaibigan na nakakasama
  mo lagi at isa kang tao na madaling maimpluwensya, I can easily judge you kung anong
  klaseng tao ka. hahaha no joke.\\nIto payo ko, kung gusto mong magimprove sa buhay
  at makaahon sarili at family mo, always be with the people na malaki ang pangarap
  sa buhay, yung makakatulong sa\u2019yo sa development mo spiritually, mentally at
  physically.\\nWag mo syempre i-aabandon ang mga dati mong friends, don\u2019t be
  mean, kakamustahin mo pa rin sila, wag ka lang lagi magsasasama sa kanila or be
  objective na maimpluwensyan mo sila for their wellfare:)\\n5. Take RISKS habang
  bata ka pa ngayon!\\nKung 25 years old ka pababa at single ka pa or wala ka pang
  anak.. I ADVICE YOU TO TAKE RISKS!!\\nIto yung panahon kung saan madami ka pang
  lakas, super alert ang katawang lupa mo, active pa ang utak mo at higit sa lahat,
  kaya pang makarecover kapag bumagsak ka mula sa mga failures.\\nBigyan kita ng example
  para intense.\\nGusto mong magbukas ng restaurant or magnegosyo, pero nagtayo ka
  nito at the age of 60 dahil playing safe ka nung kabataan mo. After ng 1 year, nalugi
  at nabankrupt kasi walang experience, hindi pinag-aralan, as in wala\u2026. ay naku
  po, ang lagay, wala ng perang pangpuhunan at di na makakuha ng trabaho dahil di
  na tinatanggap ng employers. Wala na din energy para trabahuhin ang negosyo ng 10
  hours straight kasi no energy na, di na tumalab ang Milo.\\nUulitin ko advice ko,
  TAKE RISKS lalo na sa bagay na gusto mong gawin o simulan habang bata at malakas
  ka pa!\\n6. Work hard, Push your limits!\\nNagtry ka na bang mag-jogging? Ilang
  km ang kaya mong takbuhin? Ako 10km (ahem ahem) pero hindi ko inakala na kaya ko
  pala ang 18km, pero sobrang parang mamamatay na ako nung ginawa ko un. I pushed
  my limits, kaya ko pala yun.\\nIf you want to achieve something sa buhay mo, I recommend
  you to push your limits pero wag naman to the point na masisira ang health or kung
  ano man sa buhay mo o mamamatay ka na.\\nBakit inaadvice ko un? To know more about
  yourself at ano nga ba ang capasidad at kakayahan mo \ud83d\ude42 Of course, pwede
  mo ito ipagmayabang sa mga kaibigan at kamag-anak na nakabreak ka ng record! haha.\\n7.
  Take a rest, Chill!\\nAng ikapitong numero ay ang araw ng pamamahinga ayon sa Bibliya.
  Ganun din sa buhay natin mga kapatid. Ang pamamahinga physically, emotionally, mentally
  ay kailangan lalo na at batang bata pa tayo.\\nThe more na madaming stress sa buhay
  mo ngayon, the more kang tatanda ng maaga. Ayokong tumanda ka at mamuti ang buhok
  mo ng maaga. Relaxation / rest ay parte ng buhay natin.\\nKung masyado ka ng subsob
  sa work at para sa mga pangarap mo, wag mo kalimutan na ang REST ay sangkap din
  para maging successful ka sa buhay.\\n8. Explore the world! Read books at mag-travel\\nKung
  akala mo na after mo ng school or college, hindi ka na magiging studyante, nagkakamali
  ka! Life is a never-ending exploration and never-ending learnings. Mas malaki at
  mahirap ang school after mo ng school (Ano daw?)\\nPag nasa trabaho ka na, pagaaralan
  mo ang mga dapat mong gawin para sa companya, matututo ka sa mga workmates mo, matututo
  ka sa boss mo at higit sa lahat matututo ka sa mga experiences mo araw-araw.\\nNgayon,
  bakit ko inaadvice na magbasa ng books? Simple lang, hindi lang dapat pinapakain
  ang katawan, pati utak din pinapakain lalo na kung gusto mong mag develop ng social
  skills or life skills.\\nMagagamit mo ang mga valuable infos na mababasa mo para
  sa pagtupad ng mga goals mo sa buhay, (as shortcut ba). The more you learn and wisdom
  you gain, the more chance that you will succeed in life.\\nBakit mo kailangan magtravel?
  Same as reading books, the more you explore, the more you will learn about the world
  at magiging open ang mind mo sa iba\u2019t ibang klase ng bagay.\\nMagtravel ka
  para makita mo ang mundo dahil at that age kaya mo pang umakyat sa bundok at maglakwatsa
  ng ilang kilometro. Take a fresh air sa probinsya at kung afford mo, magsky-diving
  ka habang bata ka pa.\\n9. Be Grateful / Magpasalamat ka no matter what happens\\nSa
  lahat ng maeexperience mo sa buhay mo, matumba ka man o matalo, be grateful, madami
  ka pang chance para bumangon. Ibig sabihin nun, buhay na buhay ka pa. Kahit anong
  unos, baha o bagyo man yan, be grateful at wag mareklamo sa buhay. Rather, take
  those as blessings in disguise.\\nMagpasalamat ka sa mga magulang mo, sa mga kapatid
  mo, sa mga kaibigan mo, sa mga ex mo (oops iwas iwas kapag may karelasyon na un),
  sa mga alaga mong hayop at kahit sa mga asal hayop. Kahit papaano ay may nagawa
  naman silang maganda sa mundo, hindi nga lang siguro sa\u2019yo.\\nLagi mong tandaan
  na pinadala ka dito ni God for a purpose kaya pasalamat ka at binigyan ka ng chance
  na mabuhay kasama namin \ud83d\ude42\\n10. Follow your dreams and know your PURPOSE.\\nIto
  yung pinakalast and importante na advice mula sa isang 26 year old. Gawin mo ang
  mga bagay na makakapagpasaya sa\u2019yo, ang mga pangarap mo sa buhay o ang sa tingin
  mo purpose mo sa buhay. Gusto ko lang naman na wala kang pagsisisihan pagtanda mo
  at magawa mo ang sa tingin mo ang purpose mo dito sa mundo.\\nPangarap mo ba na
  makaakyat ka ng Mount Everest or languyin ang Marianas Trench or simply magkaroon
  at makatulong sa ibang tao na nangangailangan.\\nKung hindi mo pa alam kung ano
  ang mga Goals/Dreams mo in life, I advice you to search for it habang 25 below ka
  pa lang ngayon. Baka pag nakita mo sya at the age na mamamatay ka na, It would be
  too late. Alam kong minsan na may dumapo sa isipan mo kung bakit ka nga ba pinanganak,
