  wika. Noong Hulyo 4, 2020, inilabas ang Bagong Sanlibutang Salin ng Banal na Kasulatan
  sa Bislama at Oromo. Kinabukasan, Hulyo 5, inilabas ang Bagong Sanlibutang Salin
  sa Latvian at Marathi, at inilabas naman ang Bagong Sanlibutang Salin ng Kristiyanong
  Griegong Kasulatan sa Bengali at Karen (S\u2019gaw). Sa prerecorded na mga pahayag,
  inilabas ang mga Bibliya sa elektronikong format. Naka-tie in sa espesyal na mga
  programa ang mga kapatid at masaya nilang tinanggap ang mga regalong ito mula kay
  Jehova.\\nBislama\\nAng nirebisang Bagong Sanlibutang Salin ay inilabas sa Bislama
  ni Brother Mark Sleger, isang miyembro ng Komite ng Sangay sa Fiji. Naka-tie in
  sa programa ang mga kapatid sa Vanuatu, na iniharap sa Bislama at ininterpret sa
  Bislama Sign Language.\\nTumagal nang mahigit tatlong taon ang pagsasalin ng Bibliya,
  at ginawa ng dalawang translation team. Sinabi ng isang translator: \u201cMagugustuhan
  ng mga kapatid ang nirebisang Bagong Sanlibutang Salin dahil madali itong basahin
  at ang ispeling nito ay makabago at nakaayon sa pang-araw-araw na wika. Makakatulong
  ito sa lahat na mas maunawaan ang katotohanan.\u201d\\nNagtitiwala kami na ang nirebisang
  Bibliya na ito ay tutulong sa mahigit 700 kapatid na nagsasalita ng Bislama sa kanilang
  personal na pag-aaral at ministeryo.\\nOromo\\nInilabas ni Brother Delroy Williamson,
  isang miyembro ng Komite ng Sangay sa Ethiopia, ang Bagong Sanlibutang Salin sa
  Oromo. May 12,548 kapatid na nakarinig o nakapanood ng programa, kasama na ang 2,000
  mamamahayag na nagsasalita ng Oromo.\\nDahil sa teknikal na mga limitasyon, inaprobahan
  ng Lupong Tagapamahala na ibrodkast ang prerecorded na programa sa isang istasyon
  ng telebisyon. Napakinggan din ng mga kapatid ang programa sa pamamagitan ng telepono.\\nLimang
  taon ang ginugol ng limang translator sa pagsasalin. Malaking tulong ang paglalabas
  nito para sa mga kapatid na nangangaral sa mga nagsasalita ng wikang Oromo.\\nLatvian\\nPagkatapos
  ng 12 taon ng pagsasalin, nailabas ang Bagong Sanlibutang Salin sa Latvian. Lahat
  ng kongregasyong nagsasalita ng Latvian at Russian sa Latvia ay inanyayahang manood
  ng programa.\\nSi Brother Jouni Palmu, isang miyembro ng Komite ng Sangay sa Finland,
  ang nagbigay ng pahayag sa paglalabas ng Bibliya. Sinabi niya: \u201cNatutuwa kaming
  ilabas sa inyo ang saling ito ng Bibliya na madaling basahin para sa mga mambabasa
  ng Latvian. Umaasa kaming lalo kayong masisiyahan sa pagbabasa at pagbubulay-bulay
  sa Salita ng Diyos.\u201d\\nTungkol sa mga feature sa pagre-research ng bagong inilabas
  na Bibliya, sinabi ng isang miyembro ng translation team, \u201cAng bagong salin
  na ito ng Bibliya ay parang espirituwal na \u2018gadyet\u2019 na magagamit sa personal
  na pag-aaral at pagbubulay-bulay.\u201d\\nMarathi\\nAng Bagong Sanlibutang Salin
  sa Marathi ay inilabas sa isang programa para sa lahat ng kongregasyong nagsasalita
  ng Marathi sa India. Si Brother Puneet Aggarwal, isang miyembro ng Komite ng Sangay
  sa India, ang naglabas ng Bibliya.\\nTatlong taon ang ginugol ng anim na translator
  para matapos ang proyekto ng pagsasalin sa Marathi. Ganito ang sinabi ng isang miyembro
  ng translation team: \u201cMalaki ang maitutulong ng saling ito sa mga magulang
  at sa mga nagtuturo ng Bibliya habang tinuturuan nila ang mga anak nila o ang mga
  interesado na malaman ang mga katotohanan sa Bibliya.\u201d\\nIsa pang translator
  ang nagsabi: \u201cNakakatuwang malaman na isinauli ng Bibliyang ito ang pangalan
  ng Diyos na Jehova kung saan ito lumilitaw sa orihinal na teksto. Mababasa na ang
  pangalan ni Jehova sa halos lahat ng pahina ng saling ito, at maluluwalhati ang
  pangalan ni Jehova gaya ng nararapat dito.\u201d\\nMahigit 83 milyon ang nagsasalita
  ng Marathi sa central India.\\nBengali\\nAng Kristiyanong Griegong Kasulatan sa
  Bengali ay inilabas ni Brother Ashok Patel, isang miyembro ng Komite ng Sangay sa
  India. Mahigit 1,200 mamamahayag ang naka-tie in sa programa mula sa India at Bangladesh.\\nMahigit
  265 milyon ang nagsasalita ng Bengali, ang ikapito sa pinakakaraniwang wika sa mundo.
  Para makagawa ng isang salin na madaling maintindihan ng karamihang nagsasalita
  nito, nagtulong-tulong ang isang team ng mga translator mula sa iba\u2019t ibang
  bahagi ng India at Bangladesh sa loob ng tatlong taon para matapos ang proyekto.\\nSa
  pahayag ni Brother Patel, sinabi niya: \u201cAng Bibliya sa wikang Bengali ang isa
  sa unang Bibliya na naisalin sa mga wika sa India. Inilathala noong 1801 ang kumpletong
  salin ng Kristiyanong Griegong Kasulatan. Ang kagandahan ng pinakaunang Bibliya
  sa Bengali ay ang wastong paggamit nito sa banal na pangalan ng Diyos, Jehova. Pero
  sa modernong mga salin, ang banal na pangalan ng Diyos ay pinalitan ng titulong
  \u2018Panginoon.\u2019 Ang Bagong Sanlibutang Salin ng Kristiyanong Griegong Kasulatan
  na tumpak at madaling maintindihan na salin ang sasagot diyan.\u201d\\nSinabi ng
  isang miyembro ng translation team: \u201cAng salin na ito ay patunay na mahal ng
  Diyos na Jehova ang lahat ng tao kahit iba-iba ang pinagmulan nila at inaanyayahan
  niya sila na matuto tungkol sa kaniya at sa kaniyang anak, si Jesu-Kristo.\u201d\\nKaren
  (S\u2019gaw)\\nInilabas ni Brother Hiroshi Aoki, isang miyembro ng Komite ng Sangay
  sa Myanmar, ang Kristiyanong Griegong Kasulatan sa Karen (S\u2019gaw). Naka-tie
  in sa programa ang 510 mula sa anim na kongregasyon at apat na grupo.\\nMahigit
  isang taon lang ang ginugol ng mga translator sa Karen (S\u2019gaw) para matapos
  ang proyekto. Sinabi ng isang miyembro ng translation team: \u201cMatutuwa ang mga
  kapatid at ang iba sa pagbabasa ng inilabas na Bibliyang ito sa Karen (S\u2019gaw)
  dahil ibinalik nito ang pangalang Jehova at modernong wika ang ginamit dito. Maliwanag
  ito, tumpak, at madaling maunawaan. Pinapasalamatan namin si Jehova sa napakagandang
  regalong ito na tutulong sa amin na mas mapalap\u00edt sa kaniya sa pamamagitan
  ng sarili naming wika.\u201d\\nIsa pang translator ang nagsabi: \u201cAng Bagong
